import React from "react";

//Estilos
import '../stylesheet/componentes/btn-primary.css'

//Navegacion
import { useNavigate } from "react-router-dom";

function BtnPrimary ({ruta, name, funcion}) {
    //Navegacion
    const navigate = useNavigate();

    //Action y navegacion
    const Action_navegation = () => {
        navigate(ruta)
    }

    return (
        <div >
            <button onClick={ () => Action_navegation()} className="btn-primary-style">{name}{funcion}</button>           
        </div>
    )
}

export default BtnPrimary
